    false,nt"url": null,nt"notes": "This paper provides an assessment of the
    state of knowledge of the Porcupine Caribou Herd and its habitat, drawing on analogy
    with other studies where necessary. The history of the animals, their current range,
    food habits, range studies and seasonal distribution and migration, are discussed.
    The current status and dynamics of the herd are indicated, as are major extraneous
    influences which seem likely to affect it in the near future. A map of the study
    area is included.",nt"license_title": "License Not Specified",nt"extras":
